                            color:"white" ,  
                display:"block", 
                
        }}>
            <img style={{
                width:"30px",
                height:"30px"
            }} src={nav} alt=""/>

            <il style={{
                fontWeight:"lighter",
                fontSize:"20px"
                
            }}>Food</il>
            <il style={{
                fontWeight:"lighter",
                fontSize:"20px"
            }}>Menu</il>
        

        </div>
    );

    
}
